import React from "react";
import { Link, Route } from "react-router-dom";

export default function NavBarLinks(props) {
   let eventToSend = (e) => {
      let valueToSend = {
         topic: e.target.text
      }
      const options = {
         method: 'POST',
         headers: {
            'Content-Type': 'application/json'
         },
         body: JSON.stringify(valueToSend)
      };
      fetch('/topics', options)
         .then((response) => response.json())
         .then((data) => {
            console.log(data);
         })
   }
   return (
      <div className="dropdown">
         <div className="dropbtn">
            {props.name}
            <svg
               width="1em"
               height="1em"
               viewBox="0 0 16 16"
               className="bi bi-chevron-down"
               fill="currentColor"
               xmlns="http://www.w3.org/2000/svg"
            >
               <path
                  fillRule="evenodd"
                  d="M1.646 4.646a.5.5 0 0 1 .708 0L8 10.293l5.646-5.647a.5.5 0 0 1 .708.708l-6 6a.5.5 0 0 1-.708 0l-6-6a.5.5 0 0 1 0-.708z"
               />
            </svg>
         </div>
         <div className="dropdown-content" onClick={eventToSend}>

            <a href={props.url}>{props.link1}</a>
            <a href={props.url}>{props.link2}</a>
            <a href={props.url}>{props.link3}</a>
            <a href={props.url}>{props.link4}</a>
            <a href={props.url}>{props.link5}</a>
            <a href={props.url}>{props.link6}</a>

         </div>
      </div>
   );
}
